10468.classDescription:
завтрак, обед – буфет («шведский стол»);
ужин – заказная система, 
напитки на ужин (на выбор: бокал вина / бокал пива / бокал сока / вода);
приветственный коктейль;
заключительный капитанский ужин и прощальный коктейль;
кофе-стейшн — общедоступный стол с горячими напитками и сладостями;
бутилированная вода (ежедневное обновление);
просторные каюты площадью от 10 до 22 кв.м.
в каждой каюте телевизор, холодильник, телефон, фен, сейф;
гигиенический набор (мыло, шампунь, кондиционер, гель и шапочка для душа, лосьон для тела, салфетки);
махровый халат и тапочки.

